--use [machete-wjp]
--use SQLCMD -D instead
CREATE TABLE [dbo].[Emails] (
    [ID] [int] NOT NULL IDENTITY,
    [emailFrom] [nvarchar](50),
    [emailTo] [nvarchar](50) NOT NULL,
    [subject] [nvarchar](100) NOT NULL,
    [body] [nvarchar](max) NOT NULL,
    [transmitAttempts] [int] NOT NULL,
    [statusID] [int] NOT NULL,
    [lastAttempt] [datetime],
    [attachment] [nvarchar](max),
    [attachmentContentType] [nvarchar](max),
    [RowVersion] rowversion NOT NULL,
    [datecreated] [datetime] NOT NULL,
    [dateupdated] [datetime] NOT NULL,
    [Createdby] [nvarchar](30),
    [Updatedby] [nvarchar](30),
    CONSTRAINT [PK_dbo.Emails] PRIMARY KEY ([ID])
)
CREATE TABLE [dbo].[EmailWorkOrders] (
    [Email_ID] [int] NOT NULL,
    [WorkOrder_ID] [int] NOT NULL,
    CONSTRAINT [PK_dbo.EmailWorkOrders] PRIMARY KEY ([Email_ID], [WorkOrder_ID])
)
CREATE INDEX [IX_Email_ID] ON [dbo].[EmailWorkOrders]([Email_ID])
CREATE INDEX [IX_WorkOrder_ID] ON [dbo].[EmailWorkOrders]([WorkOrder_ID])
ALTER TABLE [dbo].[Lookups] ADD [emailTemplate] [nvarchar](max)
ALTER TABLE [dbo].[Lookups] ADD [key] [nvarchar](30)
ALTER TABLE [dbo].[Lookups] ALTER COLUMN [ltrCode] [nvarchar](3)
ALTER TABLE [dbo].[EmailWorkOrders] ADD CONSTRAINT [FK_dbo.EmailWorkOrders_dbo.Emails_Email_ID] FOREIGN KEY ([Email_ID]) REFERENCES [dbo].[Emails] ([ID]) ON DELETE CASCADE
ALTER TABLE [dbo].[EmailWorkOrders] ADD CONSTRAINT [FK_dbo.EmailWorkOrders_dbo.WorkOrders_WorkOrder_ID] FOREIGN KEY ([WorkOrder_ID]) REFERENCES [dbo].[WorkOrders] ([ID]) ON DELETE CASCADE

